import React from 'react';
import Header from './header';
import Banner from './innerbanner';
import Contant from'./contant';
import Footer from '../home/footer';
import Slider from '../home/slider';



const Contact =()=>{
    return(
        <>
            <Header/> 
            <Slider/>
            <Contant/>
            <Footer/>
            </>
    )
}
export default Contact;
